                <div className="GoodCompanyTitle">
                    <h1 className="GoodCompanyText">
                        You're in great company
                    </h1>
                </div>
            </div>


            {/* Email Address, phone, address*/}


            {/* Google Maps */}
        </div>
    )
}

export default Contact
